import { extendTheme } from '@chakra-ui/react'

export const Theme = extendTheme({
  colors: {
    primary: '#398B77',
    secondary: '#297E78',
    highlight: '#227075',
    warning: '#25636F',
    danger: '#2B5565',
  },
})
